// import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
// import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';
import '../Components/Search.css';
import IC from '../image/IC logo.png'


function OffcanvasExample() {
 

  return (


    <>
      
      {[false].map((expand) => (
        
        <Navbar key={expand} bg="light" expand={expand} className="mb-3">
          
         
          <Container fluid>
            <img className="App-logo" src={IC} style={{width:"50", height:"50"}} alt="IC Logo"/>
            <Navbar.Brand href="#" style={{fontSize:"30px", fontWeight:"normal", color:"#8b2266"}}>INDIAN CULTURE</Navbar.Brand>
            <div><p>Discover, Learn, Immerse, Connect</p></div>
            <form className="w-75 text-end">
            <input type="text" className="border" placeholder="Universal Search..."  element/>
           </form>
           
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />

            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >

           
           {/* <form className="">
               <input type="text" className="border" placeholder="Search" />
           </form> */}
           
            <Navbar.Brand href="#" style={{margin:"auto", fontSize:"30px", fontWeight:"normal", color:"#8b2266"}}><img className="App-logo-side" src={IC} style={{width:"50", height:"50", margin:"10px"}} alt="IC Logo"/>INDIAN CULTURE</Navbar.Brand>
              <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                  CATAGORIES
                </Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3">
                  <Nav.Link href="#action1">Forts Of India</Nav.Link>
                  <Nav.Link href="#action2">Historic Cities</Nav.Link>
                  <Nav.Link href="#action2">Photo Essay</Nav.Link>
                  <Nav.Link href="#action2">Textile and Fabrics of India</Nav.Link>
                  <NavDropdown
                    title="Catagories"
                    id={`offcanvasNavbarDropdown-expand-${expand}`}
                  >
                    <NavDropdown.Item href="#action3">List1</NavDropdown.Item>
                    <NavDropdown.Item href="#action4">List2</NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item href="#action5">
                      Other Catagories
                    </NavDropdown.Item>
                  </NavDropdown>
                </Nav>
                

              </Offcanvas.Body>
              
              
            </Navbar.Offcanvas>
           
          </Container>


        </Navbar>
        
      ))}
      <div style={{width:'100%', flex: 1, height: '8px', backgroundColor: '#8b2266 ', margin: '-10px', marginLeft:'0px'}} />

    </>

  );


}


export default OffcanvasExample;
